import React from 'react'
import { IoIosArrowForward, IoIosArrowBack } from 'react-icons/io';




function Navigators() {
    return (
        <div className='navigators'>
            <button></button><IoIosArrowBack />
            <IoIosArrowForward />
        </div>
    )
}

export default Navigators
